Молочная каша Nestlé® Шагайка® мультизлаковая с овсяными хлопьями, кусочками земляники садовой, яблока и малиной для питания детей старше 12 месяцев согласно законодательству РФ

Сочетание злаков, кусочков фруктов и ягод создают особую структуру каши и способствуют развитию навыков жевания, тем самым готовят ребенка к переходу на"взрослый"стол.

Каждая порция детской каши Nestlé®:
• содержит всю пользу натуральных злаков;
• обеспечивает малыша дополнительной энергией;
• обогащена бифидобактериями BL – пробиотиками, которые способствуют комфортному пищеварению и укреплению иммунитета;
• содержит особенный комплекс витаминов и минеральных веществ для здорового роста и развития малыша;
• произведена под строжайшим контролем качества и по современным технологиям производства. Более 155 лет доверия и экспертизы!*

*С даты основания компании в Швейцарии.
Детские каши Nestlé®. Польза в каждой тарелочке!
